function Portfolios(props) {

    const [categories,setCategories]=useState("ALL");
    const [menuItems,setMenu]=useState(portfolio);

    //use effect use as a callback
    useEffect(()=>{

         const newvalues=portfolio.filter((item)=>{

                if(categories=="ALL")
                    return  true;
                else
                   return  categories===item.category 
         })
         setMenu(newvalues)
     },[categories])



    return (
        <div className="PortfolioPage">
            <Title title={"Portfolios"} span={"Portfolios"}></Title> 

            <div className="portfolios-data">
                <Category setCategories={setCategories}></Category>
                <MenuItems menuitems={menuItems}></MenuItems>
            </div> 
            
        </div>
    );
}

export default Portfolios;